var alert = (function(){
    var count = 0;
    var timer = 0;
    return function(msg){
        count++;
        var id = 'toast'+ count;
        $('.toast').remove()
        clearTimeout(timer)
        $('<div class="toast" id="'+id+'">'+msg+'</div>').appendTo('body').hide().fadeIn()
        timer = setTimeout(function(){
            $('.toast').fadeOut().promise().done(function(){
                $('#'+id).remove()
            })
        },2000)
    }
})();

